import React, { useState } from 'react';
import './fileup.css';
import { useNavigate } from 'react-router-dom';
import FileUpload from './upload';
import logo from './Saint-Gobain_SEFPRO_logo_2023.png';

function FileDashBoard() {
    const [showDialog, setShowDialog] = useState(false);
    const navigate = useNavigate();
    const navigateToUser = () => {
      navigate('/users');
    };
    const navigateToCustomer = () => {
      navigate('/customers');
    };
    const openDialog = () => {
      navigate('/');
      };
  const closeDialog = () => {
    setShowDialog(false);
  };

  return (
    <div className="Container4">
      <div className="Header4" style={{ display: 'flex' }}>
        <div className="logo4">
          <img src={logo} alt="logo" style={{ width: '170px', height: '100px' }} />
        </div>
        <div className="pages4">
          <p className='headerText4'>Home</p>
        </div>
        <div className="pages4">
          <p className='headerText4'>New Plan</p>
        </div>
        <div className="pages4">
          <p className='headerText4'>Track Progress</p>
        </div>
        <div className="pages4">
          <p className='home4' style={{ color: '#00C7C8' }}>FileUpload</p>
        </div>
        <div className="pages4">
          <p className='headerText4' onClick ={navigateToUser}>Users</p>
        </div>
        <div className="pages4">
          <p className='headerText4' onClick ={navigateToCustomer}>Customers</p>
        </div>
        <div >
            <button className="logout4" style={{ marginRight: '1%' }} onClick={() => setShowDialog(true)}>
          Logout</button>
        </div>
      </div>
      {showDialog && (
      <div className="dialog4">
        <label className='confirmLogout4'>Confirm Logout</label>
        <div className='buttons4'>
        <button onClick={openDialog}>YES</button>
        <button className='yesbtn4' onClick={closeDialog}>NO</button>
        </div>
      </div>
    )}
      <div className="fileupload4">
          <FileUpload />
      </div>
      
    </div> 
  );
}

export default FileDashBoard;
